import React from 'react';

function App() {
  return (
    <header class="header">

    <a href="#" class="logo"> <i class="fas fa-heartbeat"></i> Health Care. </a>

    <nav class="navbar">
        <a href="#home">home</a>
        <a href="#services">services</a>
        <a href="#about">about</a>
        <a href="#doctors">doctors</a>
        <a href="#book">book</a>
        <a href="#review">review</a>
        <a href="https://www.kibagames.com/Mini-Games">Fun games</a>
    </nav>

    <div id="menu-btn" class="fas fa-bars"></div>

</header>
  );
}

export default App;
